import React, { Component } from 'react';
import Navigation from '../Navigation';
import '../../css/swipebox.css';
import './ImageGallery.css';

import _DSC8065 from '../../images/gallery/family/_DSC8065.jpg';
import _DSC8067 from '../../images/gallery/family/_DSC8067.jpg';
import _DSC8244 from '../../images/gallery/family/_DSC8244.jpg';
import _DSC8254 from '../../images/gallery/family/_DSC8254.jpg';
import _DSC8258 from '../../images/gallery/family/_DSC8258.jpg';
import _DSC8260 from '../../images/gallery/family/_DSC8260.jpg';
import _DSC8271 from '../../images/gallery/family/_DSC8271.jpg';
import DSC04538 from '../../images/gallery/family/DSC04538.jpg';

import _DSC3987 from '../../images/gallery/landscape/_DSC3987.jpg';
import _DSC8145 from '../../images/gallery/nature/_DSC8145.jpg';
import DSC08395 from '../../images/gallery/street_photography/DSC08395.jpg';

class ImageGallery extends Component {
	constructor(props) {
		super(props);
	}
	
	componentDidMount(){
		document.title = "Family :: Mansard Photography";
	}
	
	render() {
		return (
			<div>
				<div className="wrapper">
					<Navigation />
					<div className="content galleryContent">
						<div className="galleryContainer">
							<div className="galleryPics">
								<section>
									<img src={_DSC8065} />
									<img src={_DSC8067} />
									<img src={_DSC8244} />
									<img src={_DSC8254} />
									<img src={_DSC8258} />
									<img src={_DSC8260} />
									<img src={_DSC8271} />
									<img src={DSC04538} />
								</section>
								<div className="lightbox">
									<div className="title"></div>
									<div className="filter"></div>
									<div className="arrowr"></div>
									<div className="arrowl"></div>
									<div className="close"></div>
								</div>
							</div>
							<div className="galleryAlbum">
								<ul className="albums">
									<li className="albumBox active">
										<a href="/gallery" className="" title="Fog" rel="gallery">
											<img src={_DSC8065} alt="image" />
											<span>Family, Children and Babies</span>
										</a>
									</li>
									<li className="albumBox">
										<a href="/gallery/landscape" className="" title="City" rel="gallery">
											<img src={_DSC3987} alt="image" />
											<span>Landscape</span>
										</a>
									</li>
									<li className="albumBox">
										<a href="/gallery/nature" className="" title="Street" rel="gallery">
											<img src={_DSC8145} alt="image" />
											<span>Nature</span>
										</a>
									</li>
									<li className="albumBox active">
										<a href="/gallery/street" className="" title="Mustache Guy" rel="gallery">
											<img src={DSC08395} alt="image" />
											<span>Street Photography</span>
										</a>
									</li>
									<li className="albumBox">
										<a href="#" className="" title="Mustache Guy" rel="gallery">
											<img src={small4} alt="image" />
											<span>Wildlife</span>
										</a>
									</li>
								</ul>
							</div>
						</div>
					</div>
				</div>
			</div>
		);
	}
}
export default ImageGallery;
